import { useState } from "react";
import "./App.css";
import Hello from "./Hello";

const App = () => {
  const [counter, setCounter] = useState(0);
  // setTimeout(() => setCounter(counter + 1), 1000);

  return (
    <div className="App">
      <Hello name="Andrei" age="32" />
      <p>{counter}</p>
      <button onClick={setCounter(counter +1)}>+1</button>
    </div>
  );
};

export default App;
